import React from "react";
import { socials } from "../../data/social";

const currentYear = new Date().getFullYear();

export const Footer = () => {
  return (
    <div className="px-20">
      <div className="w-1/2"></div>
      <div className="w-1/2">
        <ul>
          {socials.map((s) => (
            <li>{s.title}</li>
          ))}
        </ul>
      </div>
      <div className="flex justify-center">
        <h1 className="year">{currentYear}</h1>
      </div>
    </div>
  );
};
